import React from "react";

export default function ChatPage() {
  return (
    <div
      style={{
        padding: "20px",
        height: "100vh",
        width: "100%",
        backgroundColor: "green",
      }}
    >
      <div
        style={{
          backgroundColor: "white",
          borderRadius: "5px",
          height: "100%",
          boxShadow: "0px 0px 2px 0px",
        }}
      >
        Hello
      </div>
    </div>
  );
}
